import { Container, Grid } from "@material-ui/core";
import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import MovieSingle from "../MovieSingle";
import { actGetMovieListApi } from "./modules/action";

function MovieList(props) {
  const restaurantList = useSelector((state) => state.restaurantListReducer);
  const dispatch = useDispatch();
  if (restaurantList.data) {
    console.log(restaurantList.data.data);
  }
  useEffect(() => {
    dispatch(actGetMovieListApi());
  }, []);

  const renderMovieList = () => {
    return restaurantList.data.data.map((item) => {
      return (
        <Grid key={item._id} item={true} xs={4}>
          <MovieSingle data={item} />
        </Grid>
      );
    });
  };

  return (
    <Container maxWidth="lg">
      <Grid container spacing={3}>
        {restaurantList.data ? renderMovieList() : null}
      </Grid>
    </Container>
  );
}

export default MovieList;
